import React from 'react';
import PropTypes from 'prop-types';

const Project = () => {
  // Modified sample project data
  const projects = [
    {
      title: "EcoCart - Sustainable Shopping",
      icon: "ri-leaf-fill",
      description: "An eco-friendly shopping platform that connects users with sustainable product sellers.",
      date: "2024",
      additionalInfo: "Technologies: React, Node.js, MongoDB, Express",
      imageSrc: require('../../assets/images/EcoCart.webp'),
      animation: "zoom-in",
    },
    {
      title: "HealthTrack - Fitness Monitor",
      icon: "ri-heart-pulse-fill",
      description: "A health tracking app that leverages user data to provide customized fitness plans.",
      date: "2024",
      additionalInfo: "Technologies: Python, Django, PostgreSQL, Chart.js",
      imageSrc: require('../../assets/images/HealthTrack.webp'),
      animation: "zoom-out",
    },
    {
      title: "EduSmart - AI Tutor",
      icon: "ri-brain-line",
      description: "An AI-based educational platform that provides personalized learning plans.",
      date: "2024",
      additionalInfo: "Technologies: Python, TensorFlow, FastAPI, React",
      imageSrc: require('../../assets/images/EduSmart.webp'),
      animation: "fade-up",
    },
  ];

  return (
    <section id="project" style={styles.section}>
      <div style={styles.container}>
        {/* Projects Section */}
        <div style={styles.sectionHeader}>
          <h2 style={styles.sectionTitle}>Projects</h2>
        </div>

        <div style={styles.timelineContainer}>
          <div style={styles.timelineContent}>
            {projects.map((project, index) => (
              <TimelineCard
                key={index}
                title={project.title}
                icon={project.icon}
                description={project.description}
                date={project.date}
                additionalInfo={project.additionalInfo}
                imageSrc={project.imageSrc}
                animation={project.animation}
              />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

const TimelineCard = ({ title, icon, description, date, additionalInfo, imageSrc, animation }) => (
  <div style={styles.cardContainer}>
    <div style={styles.iconContainer}>
      <img src={imageSrc} alt={`Icon for ${title}`} style={styles.iconImage} />
    </div>
    <div style={styles.cardContent}>
      <div data-aos={animation} data-aos-duration="1200" style={styles.timelineCard}>
        <h3 style={styles.cardTitle}>
          {icon && <i className={`${icon} mr-2`}></i>} {title}
        </h3>
        <p style={styles.cardDescription}>{description}</p>
        {date && <p style={styles.cardDate}>{date}</p>}
        {additionalInfo && <p style={styles.cardAdditionalInfo}>{additionalInfo}</p>}
      </div>
    </div>
  </div>
);

TimelineCard.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
  description: PropTypes.string.isRequired,
  date: PropTypes.string,
  additionalInfo: PropTypes.string,
  imageSrc: PropTypes.string.isRequired,
  animation: PropTypes.string.isRequired,
};

// CSS-in-JS Styles
const styles = {
  section: {
    padding: '4rem 2rem',
    background: 'linear-gradient(135deg, #e1f5fe, #e8f5e9)',
    borderRadius: '0.75rem',
    boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
  },
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '0 1rem',
  },
  sectionHeader: {
    textAlign: 'center',
    marginBottom: '3rem',
  },
  sectionTitle: {
    color: '#0288d1',
    fontWeight: 'bold',
    fontSize: '2.75rem',
    marginBottom: '0.5rem',
    textTransform: 'uppercase',
    letterSpacing: '1.2px',
  },
  timelineContainer: {
    display: 'flex',
    flexDirection: 'column',
    gap: '2rem',
    padding: '2rem',
    backgroundColor: '#ffffff',
    borderRadius: '0.75rem',
    boxShadow: '0 4px 16px rgba(0, 0, 0, 0.05)',
  },
  timelineContent: {
    display: 'flex',
    flexDirection: 'column',
    gap: '2rem',
  },
  cardContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '1.5rem',
    backgroundColor: '#e3f2fd',
    padding: '1.5rem',
    borderRadius: '0.75rem',
    transition: 'transform 0.3s ease',
    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
  },
  cardContent: {
    flex: 1,
  },
  timelineCard: {
    padding: '1.25rem',
    borderRadius: '0.75rem',
    backgroundColor: '#e1f5fe',
  },
  iconContainer: {
    flexShrink: 0,
  },
  iconImage: {
    width: '70px',
    height: '70px',
    objectFit: 'cover',
    borderRadius: '50%',
  },
  cardTitle: {
    fontWeight: 'bold',
    fontSize: '1.6rem',
    color: '#0277bd',
  },
  cardDescription: {
    fontSize: '1rem',
    color: '#37474f',
    marginTop: '0.5rem',
  },
  cardDate: {
    fontStyle: 'italic',
    color: '#546e7a',
    marginTop: '0.25rem',
  },
  cardAdditionalInfo: {
    fontSize: '0.9rem',
    color: '#455a64',
    marginTop: '0.25rem',
  },
};

export default Project;
